import React from 'react';
import './Menu.css';

const MenuClient = () =>{
    return (
        <div className='menu__client'>
            <div className='client__boxes'>
                <div className='client__box box'>
                    <div className='box__img'></div>
                    <a className='box__text'>Moje konto</a>
                </div>

            </div>

        </div>
    )
}

export default MenuClient;
